const PesticidesList = (props) => {
    const price = `$${props.price}.toFixed(2)`;
    const quantity = `${props.quantity} ml`;
    return <li>
        <div>
            <h3>{props.name}</h3>
            <div>{price}</div>
            <div>{quantity}</div>

        </div>
        <div>

        </div>
    </li>

}

export default PesticidesList;
